style.css:
@-moz-document url("https://laptrinhcoban.vn/") {
element.style {
    -primary: #797979;
    -primary-rgb: 50, 155, 255;
    -success: #1CAA4D;
    -success-rgb: 28, 170, 77;
    -danger: #F33620;
    -danger-rgb: 243, 54, 32;
    -warning: #FF9900;
    -warning-rgb: 255, 153, 0;
    -dark: #000000;
    -dark-rgb: 39, 41, 61;
    -text-muted: #C0C4CC;
    -text-muted-rgb: 192, 196, 204;
    -body-background: #000000;
    -body-background-rgb: 30, 30, 47;
    -block-background: #000000;
    -block-background-rgb: 39, 41, 61;
    -component-background: #000000;
    -component-background-rgb: 39, 41, 61;
    -border: rgba(255, 255, 255, 0.05);
    -text: rgba(255, 255, 255, 0.8);
    -text-header: rgb(255, 255, 255);
    -text-second: rgba(255, 255, 255, 0.5);
    -text-placeholder: rgba(255, 255, 255, 0.2);
    -block-background-second: rgb(1 1 1);
    -block-background-disabled: rgb(1 1 1);
  }
}
